const createDatePickerObject = function (){
    //let newDate = {};
    let month = "Month";
    let day = "Day";
    let year = "Year";
    let rolling = true;
    let fullMonth = true;

    const months = [
        "January",
        "February",
        "March",
        "April",
        "May",
        "June",
        "July",
        "August",
        "September",
        "October",
        "November",
        "December"
    ];

    const daysInMonths = [ 31, 29, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31 ];

    

    function incrementMonth(step){
        if (month === "Month"){
            month = -1;
        }
        if (isValidMonth(month + step)){
            month += step;
        }
        else if (rolling === true){
            rollMonth(step);
        }
    }

    function rollMonth(step){
        if ((month + step) > 11){
            month = 0;
        }
        else if ((month + step) < 0){
            month = 11;
        }
    }

    function incrementDay(step){
        if (day === "Day"){
            day = 0;
        }
        if (isValidDay(day + step)){
            day += step;
        }
        else if (rolling === true){
            rollDay(step);
        }
    }

    function rollDay(step){
        if ((day + step) < 1){
            day = 32 + step;
        }
        else if ((day + step) > 31){
            day = 0 + step;
        }
    }

    function incrementYear(step){
        if (year === "Year"){
            year = new Date().getFullYear();
        }
        else {
            year += step;
        }

    }

    function isValidMonth(m){
        if (m >= 0 && m <= 11){
            return true;
        }

        return false;
    }

    function isValidDay(d){
        if (d > 0 && d < 32){
            return true;
        }

        return false;
    }

    function isValidYear(y){
        if (y >= 0 && y <= 9999){
            return true;
        }

        return false;
    }

    function containsValidDate(){
        return ( isValidYear(year) && isValidMonth(month) && isValidDay(day) );
    }


    function getMonth(){

        if (!isValidMonth(month)){
            return "Month"
        }

        if (fullMonth === true){
            return months[month];
        }
        else {
            return month + 1;
        }
    }

    function getDay(){
        if (!isValidDay(day)){
            return "Day"
        }

        return day;
    }
    
    function getYear(){
        if (!isValidYear(year)){
            return "Year";
        }

        return year;
    }

    function getFullDate(){
        if (containsValidDate()){
            return `${months[month]} ${day} ${year}`;
        }

        return undefined;
    }

    function getISO8601DateString(){

        if (containsValidDate()){
            let iso8601 = "";
            iso8601 += year.toString().padStart(4, '0');
            iso8601 += "-" + (month+1).toString().padStart(2, '0');
            iso8601 += "-" + day.toString().padStart(2, '0');

           return iso8601; 
        }

        return undefined;

    }

    // 1 - 12
    function setMonth(num){
        if (isValidMonth(num-1)){
            month = num - 1;
        }

    }

    function setDay(num){
        if (isValidDay(num)){
            day = num;
        }
    }

    function setYear(num){
        if (isValidYear(num)){
            year = num;
        }
    }

    return { 
        incrementMonth, 
        incrementDay, 
        incrementYear,
        getDay,
        getMonth, 
        getYear, 
        getISO8601DateString, 
        getFullDate,
        setYear,
        setMonth,
        setDay,
    };

};

